    [],nt"revision_timestamp": "2015-07-08T19:15:40.162180",nt"name": "lba-eco-cd-02-leaf-level-gas-exchange-chemistry-and-isotopes-amazonia-brazil",nt"isopen":
    true,nt"url": null,nt"notes": "This data set reports leaf gas flux and
    leaf properties from samples collected from trees, liana, pasture saplings, and
    pasture grass located at eight different sampling locations in the states of Para
    (south of Santarem) and Amazonas (near Manaus) from November 1999 through December
    2003. Data are reported on photosynthesis measurements, CO2 response curves, light
    response curves, humidity response curves, and stomatal responses to variations
    of the leaf-to-air water vapor mole fraction deficit. Leaf weight, carbon and nitrogen
    concentrations as well as stable isotope signatures for 13C and 15N are reported
    for a subset of the samples. There is one comma-delimited ASCII data file with this
    data set. ",nt"license_title": "U.S. Government Work",nt"extras": [{ntt"key":
